      isFollowed: false,
      status: "well",
      location: {
        country: "Russia",
        city: "Kirov"
      }
    },
    {
      id: "3",
      userPhoto:
        "data:image/jpeg;base64,",
      firstName: "Danila",
      lastName: "Nagov",
      isFollowed: false,
      status: "well",
      location: {
        country: "Russia",
        city: "Kirov"
      }
    },
  ]
};

export type UserType = {
  id: string,
  userPhoto: string
  firstName: string
  lastName: string
  isFollowed: boolean
  status: string
  location: {
    country: string,
    city: string
  }
}

type ActionsType = ReturnType<typeof followUserAC> | ReturnType<typeof unfollowUserAC>

const usersReducer = (state = usersState, action: ActionsType) => {
  switch (action.type) {
    case "usersPage/followUser":
      return {
        ...state,
        users: [...state.users]
      }
    case "usersPage/unFollowUser":
      return {
        ...state
      }
    default:
      return state;
  }
};

export const followUserAC = (userId: string) => {
  return {type: "usersPage/followUser", userId: "3"} as const
} 
export const unfollowUserAC = (userId: string) => {
  return {type: "usersPage/unFollowUser", userId: "3"} as const
} 

export default usersReducer;
